class List extends Component {
    rd4(){
        return Math.floor((1 + Math.random()) * 0x10000).toString(16).substring(1);
    }
    AutoId=()=>{
        return this.rd4() + this.rd4() +'_'+this.rd4()+this.rd4();
    }
  render() {
    return (


        <tr className="">
          <td className="">{this.AutoId}</td>
          <td className="">Cell</td>
          <td className="">Cell</td>
          <td className="">
            <div className="edit">
              <button className="ui yellow button">Revise</button>
              <button className="ui black button">Delected</button>
            </div>
          </td>
        </tr>

    );
  }
}

export default List;
